import React, { useState, useEffect } from 'react';




const Card = ({ apiKey }, props) => {

    const [users, setUser] = useState([]);

    const getUser = async () => {
        const response = await fetch('https://api.data.gov.in/resource/93b75aee-8eed-4fd5-913f-8284ffe733e8?api-key=579b464db66ec23bdd000001d8a81c4d7ec9481349495e230cdaab42&format=json')
        setUser(await response.json());
    }


    // const listItems = users.map((id, name, type) => {
    //     return (
    //         <li field={id}>{name}{type}</li>
    //     );
    // });

    useEffect(() => {
        getUser();
    }, [apiKey]);

    return (
        <div class="card-group">
            <div class="card">
                <div className="card-body">
                    <img src="https://s3.ap-southeast-1.amazonaws.com/imgnew.outlookindia.com/uploadimage/library/16_9/16_9_5/IMAGE_1643090345.jpg" class="card-img" alt="text">
                    </img>
                    <h6 class="card-title">
                        {users.title}</h6>
                    {/* <ul>
                        {listItems}
                    </ul> */}

                    <h6 class="card-text">{users.desc}</h6>
                    <h6 class="card-text">{users.org_type}</h6>
                    <h6 class="card-text">{users.org}</h6>
                    <h6 class="card-text">{users.sector}</h6>
                    <h6 class="card-text">{users.source}</h6>
                    <h6 class="card-text">{users.index}</h6>

                    {/* <h6 class="card-text">{users.target_bucket.index}</h6>
                    <h6 class="card-text">{users.target_bucket.type}</h6>
                    <h6 class="card-text">{users.target_bucket.field}</h6>

                    <h6 class="card-text">{users.field[0].id}</h6>
                    <h6 class="card-text">{users.field[0].name}</h6>
                    <h6 class="card-text">
                        {users.field[0].type}</h6> */}

                </div>

            </div >
        </div>








    );
}

export default Card;
